import React, { Component } from "react";
import ComicBox from "../components/ComicBox"
import Jumbotron from "../components/Jumbotron";

class Home extends Component {

    render() {
        return (
            <>
                <Jumbotron>
                    Welcome to the home page!
                </Jumbotron>
                <ComicBox></ComicBox>
            </>
        );
    }
}

export default Home;
